import axios from 'axios'

export const callSpotifyApi = () => {
    console.log(`this was the api call`)

    const requestConfig = {
        headers: {
            'Authorization': 'Bearer ' + accessToken
        },
    }

    return axios.get('https://api.spotify.com/v1/me/playlists', requestConfig)

}
